import heapq

def topKFrequent(nums, k):
    freq_map = {}
    for num in nums:
        freq_map[num] = freq_map.get(num, 0) - 1
    min_heap = []
    for (num, freq) in freq_map.items():
        heapq.heappush(min_heap, (freq, num))
        if len(min_heap) > k:
            heapq.heappop(min_heap)
    result = []
    while min_heap:
        result.append(heapq.heappop(min_heap)[1])
    result.reverse()
    return result

